import React from "react";
import Data from "../project_data/data_store";
const Project =()=>{
  const dataStore = Data.posts;
return(
  <>
  <h1>data</h1>
  {dataStore.map((e) => {
    return(
<h1>id: {e.id}</h1>
    )
   })}
</>
)
}

export default Project;
